import React from 'react'
import {Connect} from 'redux'

const CounterUp = ({up}) =>
    <button onClick={up}>
        Up
    </button>

const stmp = (state) => {}

const dtmp = (dispatch) => {
    return {
        up: () => {
            dispatch({type:"UP"})
            alert("UP")
        }
    }
}

export default Connect(stmp, dtmp)(CounterUp)
